export const getFetch = (id) => {
  return new Promise((resolve, reject) => {
    if(id){
      resolve(myData.find(prod => prod.id === id));
    } else {
      resolve(myData);
    }
  });
}

export const getFetchCategory = (category) => {
  return new Promise((resolve, reject) => {
    const myArray = myData.filter(element => element.category === category)
    console.log(myArray);
    resolve(myArray);
  });
}
